import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const displayProperty = (property) => {
    return (
        <>
        <div className="hero">
            <div className="hero-nody">

            </div>
        </div>

        <div class="card">
        <header class="card-header">
            <p class="card-header-title">
            Component
            </p>
            <button class="card-header-icon" aria-label="more options">
            <span class="icon">
                <i class="fas fa-angle-down" aria-hidden="true"></i>
            </span>
            </button>
        </header>
        <div class="card-content">
            <div class="content">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus nec iaculis mauris.
            <a href="#">@bulmaio</a>. <a href="#">#css</a> <a href="#">#responsive</a>
            <br/>
            <time datetime="2016-1-1">11:09 PM - 1 Jan 2016</time>
            </div>
        </div>
        <footer class="card-footer">
            <a href="#" class="card-footer-item">Save</a>
            <a href="#" class="card-footer-item">Edit</a>
            <a href="#" class="card-footer-item">Delete</a>
        </footer>
        </div>
        </>
    );
};

const MyPropertyList = () => {
    const [properties, setProperties] = useState([]);
    const [userID, setUserID] = useState(-1);
    const navigate = useNavigate();

    useEffect(() => {
        
        // get the user id
		fetch("http://127.0.0.1:8000/accounts/info/",{
            method: 'GET',
            headers: {
                'Authorization': 'Bearer ' + localStorage.getItem('token')
            }
        })
        .then((response) => response.json())
        .then((data) => {
            setUserID(data.id);
        }
        ).then(() => {
            if (userID === -1) {
                return ;
            }

            // get the properties that belong to the user
            fetch("http://localhost:8000/property/list/?owner=" + userID, {
                method: 'GET',
                headers: {
                    'Authorization': 'Bearer ' + localStorage.getItem('token')
                }
            })
            .then((response) => response.json())
            .then((data) => {
                setProperties(data.properties);
            }
            );
        });
    }, [userID]);


    console.log(properties);
    const displayProperties = properties.map((property) => {
        console.log("A");
        console.log(property);
        return displayProperty(property);
    });

    return (
        <>
            <div className="container">
                {displayProperties}
            </div>
        </>
    );
};

export default MyPropertyList;
